  false,\n\t\"url\": null,\n\t\"notes\": \"The Wheeler National Wildlife Refuge Water
  Management Plan has been developed to meet the station objectives. The purpose of
  this plan is to establish a schedule of operations for the manipulation of managed
  waters. Each water unit's management is covered. Topics include, flowline elevation,
  elevation of pool bottom, surface elevations, water supply, biological conditions
  and wildlife use, and objective for proposed levels. This plan describe water management
  for Wheeler National Wildlife Refuge in 1998.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
